          setEnergyRepData(repData);
        }
      } catch (error) {
        console.error('âŒ Error loading energy rep data:', error);
        // Fallback data
        setEnergyRepData([
          {
            id: 1,
            name: 'Sample REP',
            projectedCommissions: 45000,
            receivedCommissions: 42000,
            variance: -3000,
