              </Typography>
            </Box>
          </>
        )}

        {filteredCommissions.length === 0 && activeTab === 0 && (
          <Box className="commission-empty-state">
            <Typography className="commission-empty-icon">
              ðŸ’°
            </Typography>
            <Typography variant="h6" className="commission-empty-text">
